//日志输出
function addLog(message){
    return new Promise(function (resolve, reject){
        try {
            let need_clear = document.querySelectorAll("div.iframe div.program p.now");
            for (let i = 0; i < need_clear.length; i++) {
                need_clear[i].setAttribute("class", "");
            }
        } catch {}
        let div = document.querySelector("div.iframe div.program");
        let p = document.createElement("p");
        div.appendChild(p);
        let i = 0;
        let time = setInterval(function(){
            if (i == message.length){
                clearInterval(time);
                p.setAttribute("class", "now");
                resolve();
            } else {
                p.innerHTML += message[i];
                div.scrollTop = div.scrollHeight;
            }
            i++;
        },50);
    });
}

//toast输出
function createToast(id, mes, time = 5) {
    const notifications = document.querySelector('.notifications');
    const toastDetails = {
        success:{
            icon: 'fa-circle-check',
            text: 'Success: This is a success toast.'
        },
        error:{
            icon: 'fa-circle-xmark',
            text: 'Error: This is a error toast.'
        },
        warning:{
            icon: 'fa-circle-exclamation',
            text: 'Warning: This is a warning toast.'
        },
        info:{
            icon: 'fa-circle-info',
            text: 'Info: This is a info toast.'
        }
    };
    if (document.querySelector("style.i"+time)){
        document.querySelector("style.i"+time).innerHTML = ".toast.i"+time+"::before{animation-duration: "+time+"s;}";
    } else {
        var style = document.createElement("style");
        style.className = "i"+time;
        style.innerHTML = ".toast.i"+time+"::before{animation-duration: "+time+"s;}";
        document.getElementsByTagName("head")[0].appendChild(style);
    }
    // console.log(id)
    const {icon, text} = toastDetails[id];
    let txt;
    if (mes == "" || mes == null || typeof(mes) == "undefined"){
        txt = text;
    } else {
        txt = mes;
    }
    const toast = document.createElement('li') // 创建li元素
    toast.setAttribute("time", time);
    toast.setAttribute("style", "::before{animation-duration: "+time+"}")
    toast.className = `toast ${id} i${time}` // 为li元素新增样式
    toast.innerHTML = `<div class="column">
    <i class="fa-solid ${icon}"></i>
    <span>${txt}</span>
    </div>
    <i class="fa-solid fa-xmark" onClick="removeToast(this.parentElement)"></i>`
    notifications.appendChild(toast) // 添加元素到 notifications ul
    // 隐藏toast
    if (time != 0){
        toast.timeoutId = setTimeout(()=> removeToast(toast), time * 1000);
    }
}

//toast移除
function removeToast(toast) {
    toast.classList.add('hide')
    if( toast.timeoutId) clearTimeout(toast.timeoutId) // 清楚setTimeout
    // 移除li元素
    setTimeout(() => {
        toast.remove()
    },500)
}

//页面滚动
function readScroll(isPause = true, location = 0, wait = 100){
    return new Promise(async function (resolve, reject) {
        if (location == 0) {
            location = document.body.scrollHeight - window.innerHeight;
        }
        if (!isPause) {
            await scrollFromTo(location, 50);
            return resolve();
        }
        var scroll = 0;
        if (location - document.documentElement.scrollTop > 0) {
            while (location - document.documentElement.scrollTop > 0) {
                try {
                    scroll += random(450, 850);
                    if (scroll > location) {
                        scroll = location;
                    }
                    await scrollFromTo(scroll);
                } catch(error) {
                    console.log(error);
                    return resolve();
                }
                await justWait(wait, wait + 200, false);
            }
        } else if (location - document.documentElement.scrollTop < 0) {
            while (location - document.documentElement.scrollTop < 0) {
                try {
                    scroll += random(450, 850);
                    if (document.documentElement.scrollTop - scroll < location) {
                        scroll = document.documentElement.scrollTop - location;
                    }
                    await scrollFromTo(document.documentElement.scrollTop - scroll);
                } catch(error) {
                    console.log(error);
                    return resolve();
                }
                await justWait(wait, wait + 200, false);
            }
        }
        return resolve();
    });
}

function scrollFromTo(to, threshold = 10){
    return new Promise(async function (resolve, reject) {
        var from = document.documentElement.scrollTop;
        var velocity = 0.1;
        var total = to - from;
        if (total > 0) {
            for (let i = from; to - i > 0; i += velocity) {
                if (velocity < 0.01) {
                    i = to;
                } else if ((i - from) / total > 0.5) {
                    velocity = threshold * Math.sin(Math.PI * (i - from) / total);
                } else if (threshold * Math.sin(Math.PI * (i - from) / total) > 0.1) {
                    velocity = threshold * Math.sin(Math.PI * (i - from) / total);
                }
                window.scrollTo(0, i);
                await justWait(Number.MIN_VALUE, 0, false);
            }
        } else if (total < 0) {
            total = Math.abs(to - from);
            for (let i = from; i - to > 0; i -= velocity) {
                if (velocity < 0.01) {
                    i = to;
                } else if ((i - from) / total > 0.5) {
                    velocity = threshold * Math.sin(Math.PI * (from - i) / total);
                } else if (threshold * Math.sin(Math.PI * (from - i) / total) > 0.1) {
                    velocity = threshold * Math.sin(Math.PI * (from - i) / total);
                }
                window.scrollTo(0, i);
                await justWait(Number.MIN_VALUE, 0, false);
            }
        }
        window.scrollTo(0, to);
        return resolve();
    });
}


