async function video() {
    if (GM_getValue("watching") != "true") {
        return;
    }
    await readScroll(false, document.querySelector("header").scrollHeight);
    var start_time = Date.now();
    var video = document.querySelector("video");
    if (!video.muted) {
        video.muted = true;
    }
    let retry = 0;
    while (video.paused) {
        if (retry == 0) {
            try {
                document.querySelector("div.outter").click();
            } catch {}
            retry++;
        } else if (retry == 1) {
            try {
                document.querySelector("div.prism-play-btn").click();
            } catch {}
            retry++;
        } else if (retry == 2) {
            try {
                video.play();
            } catch {}
            retry++;
        } else {
            break;
        }
        await justWait(1000,0);
    }
    await addLog("开始观看...");
    await addLog("已观看 0 s...");
    video.addEventListener('pause', async function () {
        if (video.currentTime > video.duration - 1) {
            await addLog("观看完毕...");
            GM_setValue("watching", "false");
            await justWait(1000, 3000);
            closeWindow();
        } else {
            let retry = 1;
            while (video.paused) {
                if (retry == 1) {
                    try {
                        document.querySelector("div.prism-play-btn").click();
                    } catch {}
                    retry++;
                } else if (retry == 2) {
                    try {
                        video.play();
                    } catch {}
                    retry++;
                } else {
                    break;
                }
                await justWait(1000,0);
            }
        }
    });
    let watch_time;
    while (true) {
        try {
            watch_time = document.querySelector("div.iframe div.program p.now");
            break;
        } catch {
            await justWait(500, 0, false);
        }
    }
    let total_time;
    if (video.duration > 120) {
        total_time = random(80, 100);
    } else {
        total_time = video.duration - 3;
    }
    while ((Date.now() - start_time) / 1000 < total_time) {
        watch_time.innerHTML = "已观看 " + ((Date.now() - start_time) / 1000).toFixed() + " s...";
        await justWait(1000, 0, false);
    }
    if (video.duration > 120) {
        video.currentTime = video.duration - 3;
    }
}

