async function exam() {
    while (true) {
        if (document.querySelector("div.question") && document.querySelector("div.question").innerHTML) {
            break;
        }
        if (document.querySelector("div.practice-result")) {
            //出现结果，说明答完了
            return;
        }
        if (document.querySelector("div.nc-xi-container")) {
            //出现验证滑块
            createToast("warning", "测试消息", 0);
            return;
        }
        if (document.querySelector("div.explain")) {
            //出现答案解析，说明答错了，退出重做
            document.querySelector("a[href*=\"exam-index.html\"]").click();
            await justWait(500, 1000);
            document.querySelector(".ant-modal-confirm-btns button.ant-btn").click();
            return;
        }
        await justWait(500, 0);
    }
    if (document.documentElement.scrollTop == 0) {
        readScroll(false, 450);
    }
    var type = document.querySelector("div.q-header").innerHTML.match(/多选题|单选题|填空题/)[0];
    await justWait(1500, 4500);
    var result;
    if (type == "单选题") {
        result = await examSingleChoice();
    } else if (type == "多选题") {
        result = await examMultipleChoice();
    } else if (type == "填空题") {
        result = await examFillBlanks();
    }
    await justWait(800, 2000);
    if (result) {
        let check_button = document.querySelector("button.ant-btn");
        let check_button_location = check_button.getBoundingClientRect();
        if (check_button_location.y > window.innerHeight - check_button_location.height) {
            console.log("确认按钮不在视窗内");
            await readScroll(true, document.documentElement.scrollTop + check_button_location.y - window.innerHeight + 2 * check_button_location.height);
            await justWait(300,500)
        }
        check_button.click();
        await justWait(2000, 0);
        exam();
    } else {
        //document.querySelector("a[href*=\"exam-index.html\"]").click();
        await justWait(500, 1000);
        //document.querySelector(".ant-modal-confirm-btns button.ant-btn").click();
    }
}

function examSingleChoice() {
    return new Promise(async function (resolve, reject) {
        document.querySelector("span.tips").click();
        await justWait(800, 1500,false);
        var options = document.querySelectorAll("div.q-answer");
        var tips;
        if (!document.querySelector("font")) {
            return resolve(false);
        }
        if (document.querySelectorAll("font").length == 1) {
            tips = document.querySelector("font").innerHTML;
            document.querySelector("span.tips").click();
            await justWait(800, 1500,false);
            let option;
            //精确匹配
            for (let i = 0; i < options.length; i++) {
                option = options[i].innerHTML.replace(/[A-Z]\.\s+/,"");
                if (option == tips) {
                    options[i].click();
                    return resolve(true);
                }
            }
            //精确匹配没有结果，再用模糊匹配
            for (let i = 0; i < options.length; i++) {
                option = options[i].innerHTML.replace(/[A-Z]\.\s+/,"");
                if (option.indexOf(tips) != -1 || tips.indexOf(option) != -1) {
                    options[i].click();
                    return resolve(true);
                }
            }
        } else {
            tips = document.querySelectorAll("font");
            document.querySelector("span.tips").click();
            await justWait(800, 1500,false);
            let option, option_split, result;
            for (let i = 0; i < options.length; i++) {
                option = options[i].innerHTML;
                option_split = option.split(/[\s-]/);
                result = true;
                for (let j = 1; j < option_split.length; j++) {
                    if (tips[j-1].innerHTML.indexOf(option_split[j]) == -1 && option_split[j].indexOf(tips[j-1].innerHTML) == -1) {
                        result = false;
                        break;
                    }
                }
                if (result) {
                    options[i].click();
                    return resolve(true);
                }
            }
        }
        return resolve(false);
    });
}

function examMultipleChoice() {
    return new Promise(async function (resolve, reject) {
        var options = document.querySelectorAll("div.q-answer");
        if (document.querySelector("div.q-body").childNodes[0].innerHTML.match(/（）/g).length == options.length) {
            for (let i = 0; i < options.length; i++) {
                options[i].click();
                await justWait(200,400,false);
            }
            return resolve(true);
        }
        document.querySelector("span.tips").click();
        await justWait(800, 1500,false);
        var fonts = document.querySelectorAll("font");
        var tips = [];
        for (let i = 0; i < fonts.length; i++) {
            tips[i] = fonts[i].innerHTML;
        }
        document.querySelector("span.tips").click();
        await justWait(800, 1500,false);
        var option;
        var result = true;
        for (let i = 0; i < options.length; i++) {
            option = options[i].innerHTML.replace(/[A-Z]\.\s+/,"");
            for (let j = 0; j < tips.length; j++) {
                if (tips[j].indexOf(option) != -1 || option.indexOf(tips[j]) != -1) {
                    options[i].click();
                    await justWait(200,400,false);
                }
            }
        }
        return resolve(true);
    });
}

function examFillBlanks() {
    return new Promise(async function (resolve, reject) {
        document.querySelector("span.tips").click();
        await justWait(800, 1500,false);
        if (!document.querySelector("font")) {
            return resolve(false);
        }
        var tips = document.querySelector("font").innerHTML;
        document.querySelector("span.tips").click();
        await justWait(800, 1500,false);
        var event = new Event('input', { bubbles: true });
        document.querySelector("input.blank").setAttribute("value", tips);
        document.querySelector("input.blank").dispatchEvent(event);
        return resolve(true);
    });
}
